import React, { Component } from "react";
import 'public/darth-vader.jpg'
import 'public/luke-skywalker.jpg'

class User extends Component {

  // renderUsers = () => {
  //   return this.props.users.map(user => <br>{user.name}</br>)
  // }

  render() {
    // console.log(this.props)
    return (

      <div className='left-nav' onClick={() => this.props.selectUser(this.props.user)}>
        {this.props.user.name} {this.props.user.name === 'Darth Vader'? <img src='public/darth-vader.jpg'></img>: <img src='public/luke-skywalker.jpg'></img>}
      </div>

    );
  };

}

export default User;
